import React from 'react';
import C from './Messages.module.css'
import MessageItem from './Message1/Message1';
import DialogItem from './DialogItem/DialogItem';

const Messages = (props) => {
debugger;
let userElem = props.State.usersData.map( (dialog)=> <DialogItem name={dialog.name} id={dialog.id} />);


let messageElem = props.State.messageData.map( (message)=> <MessageItem message={message.message}/>);

    return (
        <article className={C.article}>
            <div className={C.users}>
                {userElem}
            </div>
            <div className={C.messages}>
                {messageElem}
            </div>
        </article>
    )
}

export default Messages;
